import { Component } from '@angular/core';
import { FontAwesomeModule } from '@fortawesome/angular-fontawesome';

@Component({
  selector: 'app-doctorlist',
  templateUrl: './doctorlist.component.html',
  styleUrls: ['./doctorlist.component.css']
})
export class DoctorlistComponent {
  faSearch = faSearch; // Assuming you have imported faSearch icon

  hovered: number | null = null;
  searchTerm: string = "";
  filteredDoctors: any[] = [];

  indianDoctors = [
    // ... (Your doctor data remains unchanged)
  ];

  handleSearch() {
    this.filteredDoctors = this.indianDoctors.filter(doctor =>
      doctor.name.toLowerCase().includes(this.searchTerm.toLowerCase())
    );
  }

  setHovered(doctorId: number) {
    this.hovered = doctorId;
  }

  buttonHoverEffect(event: MouseEvent) {
    (event.target as HTMLButtonElement).style.backgroundColor = "#0056b3";
  }

  buttonLeaveEffect(event: MouseEvent) {
    (event.target as HTMLButtonElement).style.backgroundColor = "#007bff";
  }
}
